import React, { useState, useEffect } from "react"
import { Link } from "react-router-dom"

const Tracks = props => {
    console.log(props.location.state.history)
    return (
        <div>
            Tracks! Linked here by {props.location.state.list.name}
            <Link to={{
                pathname: "/main/",
                state: {
                    history: props.location.state.history,
                    cachedPlaylist: props.location.state.playlist
                }
            }}> Go back </Link>
        </div>
    )
}

export default Tracks
